import React, { useState } from "react";
import { ThemeProvider, Modal, Div, Row, Col, Button, Text, Container, Icon } from "atomize";


import NetflixModal from "./NetflixModal"

function MyCliques() {
  const [modal, showModal] = useState(false)

  return(
    <Div>
    <Row>
      <Row d="flex" justify="space-between">
        <Text
          textSize="display1"
          textColor="black"
          fontFamily="primary"
        >
          My Cliques
        </Text>
        <Icon
          name="Add New Clique"
          color="black"
          size="20px"
        />
      </Row>
      <NetflixModal
        isOpen={modal}
        onClose={() => showModal(false)}
      />
    </Row>
    </Div>
  )
}

export default MyCliques;
